;
function StorageManager(localStorage){

	this.setCoordinates = function(location){
		localStorage.setItem("lastCoordinates", JSON.stringify({
			latitude: location.latitude,
			longitude: location.longitude,
		}));
	}

	this.getCoordinates = function(){
		return JSON.parse(localStorage.getItem("lastCoordinates"));
	}

}
;
MapManager = function(containerId){	
	var manager = this;
	var containerId = containerId;
	var mapMarkers = [];

	this.mapOptions = new Backbone.Model({
		zoom: 14,
		latitude: 37.7750,
		longitude: -122.4183,
	});

	function buildPosition(){
		return new google.maps.LatLng(manager.mapOptions.get("latitude"), manager.mapOptions.get("longitude"));
	}

	function buildMapOptions(){
		return {
			zoom: manager.mapOptions.get("zoom"),
			center: buildPosition(),
			mapTypeId: google.maps.MapTypeId.ROADMAP,
			zoomControl: false,
			panControl: false
		}
	}

	function calculateMapHeight(){
		var pageHeight, headerHeight, footerHeight;
		pageHeight = parseInt($("body").css('height'));
		headerHeight = parseInt($(".header").css('height'));
		footerHeight = parseInt($("[data-role='footer']").css('height'));

		return pageHeight - headerHeight - footerHeight + 50 + "px";
	}

	this.showMap = function(){
		manager.map = new google.maps.Map(document.getElementById(containerId), buildMapOptions());

		_.each(studiosManager.studios.models, function(studio){
			var marker = new google.maps.Marker({
			    position: new google.maps.LatLng(studio.get('latitude'), studio.get('longitude')),
			    map: manager.map,
			    icon: "images/yoga_icon_small.png"
			});

			mapMarkers.push(marker);								
			google.maps.event.addListener(marker, 'click', function() {
			    manager.map.panTo(marker.position);
			}); 
		});

		var marker = new google.maps.Marker({
		    position: new google.maps.LatLng(locationManager.userLocation.get('latitude'), 
		    	locationManager.userLocation.get('longitude')),
		    map: manager.map,
		});

		$('#content').css('height', calculateMapHeight());
		google.maps.event.trigger(manager.map,'resize');
	}

	this.destroyMap = function(){
		delete manager.map;
		_.each(mapMarkers,function(marker){ delete marker });
		$("#" + containerId).css('background-color', '');
		$("#" + containerId).html('');
	}

	manager.mapOptions.bind("changeCoordinates", function(){
		manager.map.setOptions( buildMapOptions() );			
	});
}
;
LocationManager = function(){
	this.apiHost = "http://yoganow-api.herokuapp.com";

	var manager = this;

	var UserLocation = Backbone.Model.extend({
		coordinates: function(){
			return this.get("latitude") + "," + this.get("longitude");
		}
	});

	this.userLocation = new UserLocation;

	function onSuccess(position) {
	    manager.userLocation.set({
	    	latitude: position.coords.latitude,
	    	longitude: position.coords.longitude
	    });

	    manager.userLocation.trigger("changeCoordinates");
	}

	this.updateCity = function() {
		$.getJSON(manager.apiHost + "/location.json?location=" + manager.userLocation.coordinates(),function(data){
			manager.userLocation.set("city", data.city);
		});
	};

	this.geolocate = function(){
		navigator.geolocation.getCurrentPosition(onSuccess);
	};

	this.userLocation.on("changeCoordinates", function(){
		manager.updateCity();
	})
}
;
StudiosManager = function(){
	var manager = this;
	this.apiHost = "http://yoganow-api.herokuapp.com";

	this.state = new Backbone.Model;

	this.Studio = Backbone.Model.extend({});
	this.Studios = Backbone.Collection.extend({
		model: manager.Studio,
		parse: function(response){
			window.studios = response.yoga_studios;
			_.each(response.yoga_studios, function(studio){
				studio.distance = parseFloat(studio.distance).toFixed(2);
			});
			return response.yoga_studios;
		}
	});

	this.studios = new manager.Studios;
	this.views = [];

	this.showStudios = function(){
		studiosView = new ListView({
			collection: manager.studios
		});
		manager.views.push(studiosView);
		
		$("#content").html( studiosView.render() );
		$("#content").css('height', '100%');
	}

	this.removeStudios = function(){
		_.each(manager.views,function(view) { delete view }) ;
		$("#content").html("");
	}

	manager.state.on("change:location", function(){
		url = apiHost + "/yoga_studios.json?location=" + manager.state.get('location');
		manager.studios.fetch({
			url: url,
			success: function(){ manager.showStudios() }
		});
	});

}
;
ListItemView = Backbone.View.extend({		
	template: _.template($("#listItemTemplate").html()),
	render: function(){
		this.model.attributes
		return this.template(this.model.attributes);
	}
});
ListView = Backbone.View.extend({
	initialize: function(){
		this.collection.bind("reset", function(){
			this.render();
		}, this);
	},
	template: _.template($("#listTemplate").html()),
	render: function(){

		$ul = $(this.template({}));
		_.each(this.collection.models, function(studio){
			$li = $( (new ListItemView({ model: studio })).render());
			$ul.append($li);
		});

		return $ul;
	}
});
TitleView = Backbone.View.extend({
	template: _.template($("#headerTemplate").html()),
	initialize: function() {
		var view = this;
		this.model = new Backbone.Model();
		this.model.on("change:value", function() { view.render() });
		this.setTitle("Yoga Now");
	},
	setTitle: function(title){
		this.model.set("value", title);
	},
	render: function() {			
		$(".header").html(this.template(this.model.attributes));
	}
});
Router = Backbone.Router.extend({

	routes: {
	  "map": "map",   
	  "list": "list",  
	},

	map: function() {
		window.mapManager.showMap();
	},

	list: function() {		
	    window.mapManager.destroyMap();
	    window.studiosManager.showStudios();		 
	}
});














apiHost = "http://yoganow-api.herokuapp.com"

document.addEventListener("deviceready", function(){
	navigator.splashscreen.hide();
}, false);

$(function(){	

	$.mobile.linkBindingEnabled = false;
	$.mobile.hashListeningEnabled = false;
	$('[data-position=fixed]').fixedtoolbar({ tapToggle:false});
	$.mobile.loading('hide');

	window.mapManager 	    = new MapManager("content"); 
	window.locationManager  = new LocationManager;
	window.studiosManager   = new StudiosManager();
	window.app 				= new Router();

	$("#map").on('click',function(){ app.navigate("/map", true) });
	$("#list").on('click',function(){ app.navigate("/list", true) });
	
	titleView = new TitleView;

	locationManager.userLocation.on('change:city', function(){		
		titleView.setTitle("Yoga Now in " + locationManager.userLocation.get('city'));
	});

	locationManager.userLocation.on("changeCoordinates", function(){
		studiosManager.state.set("location", locationManager.userLocation.coordinates());
		mapManager.mapOptions.set({
			latitude: locationManager.userLocation.get("latitude"),
			longitude: locationManager.userLocation.get("longitude")
		});
	});

	locationManager.geolocate();
	$("#content").css('height', '100%');
	Backbone.history.start();
});



